sprites.onOverlap(SpriteKind.Player, SpriteKind.Transport, function (sprite, otherSprite) {
    if (LevelCounter == 0) {
        if (sprite.overlapsWith(Transport_1)) {
            info.changeScoreBy(5)
            LevelCounter = LevelCounter + 1
            createlevel()
        } else if (sprite.overlapsWith(Transport_5)) {
            info.changeScoreBy(1)
            LevelCounter = LevelCounter + 1
            createlevel()
        }
    }
    if (LevelCounter == 1) {
        if (sprite.overlapsWith(Transport_1)) {
            info.changeScoreBy(5)
            LevelCounter = LevelCounter + 1
            createlevel()
        } else if (sprite.overlapsWith(Transport_5)) {
            info.changeScoreBy(1)
            LevelCounter = LevelCounter + 1
            createlevel()
        } else if (sprite.overlapsWith(Transport_2)) {
            info.changeScoreBy(10)
            LevelCounter = LevelCounter + 1
            createlevel()
        }
    }
    if (LevelCounter == 2) {
        if (sprite.overlapsWith(Transport_2)) {
            info.changeScoreBy(10)
            LevelCounter = LevelCounter + 1
            createlevel()
        } else if (sprite.overlapsWith(Transport_3)) {
            info.changeScoreBy(5)
            LevelCounter = LevelCounter + 1
            createlevel()
        } else if (sprite.overlapsWith(Transport_5)) {
            info.changeScoreBy(1)
            LevelCounter = LevelCounter + 1
            createlevel()
        }
    }
    if (LevelCounter == 3) {
        if (sprite.overlapsWith(Transport_2)) {
            info.changeScoreBy(10)
            LevelCounter = LevelCounter + 1
            createlevel()
        } else if (sprite.overlapsWith(Transport_4)) {
            info.changeScoreBy(3)
            LevelCounter = LevelCounter + 1
            createlevel()
        } else if (sprite.overlapsWith(Transport_5)) {
            info.changeScoreBy(1)
            LevelCounter = LevelCounter + 1
            createlevel()
        }
    }
    if (LevelCounter == 4) {
        Point()
    }
})
